import React from "react";
import PopulateCars from "./PopulateCars";
import { useState, useEffect} from "react";
import Api from "../../api";
import Spinner from 'react-bootstrap/Spinner';


export default () => {

  let [cars, setCars] = useState([]);
  console.log(cars);
  let fetchCars = async () => {
    let api = new Api();
    let allCars = await api.getAllCars();
    setCars(allCars);
  }
  useEffect(() => {
    fetchCars();
  }, []);


  return (
    <section id="cars_section" className="bg-cyan-50  min-h-screen"  >
      <div class="container max-w-6xl mx-auto my-32 px-6 text-gray-900 pt-5 md:px-0">
        <div class="flex justify-around mb-20">
        <i className="h-60 fa-solid fa-car-side"></i>

          <input
            type="text"
            class="border-2 w-60 text-center rounded-lg placeholder-purple-500 focus:outline-none"
            placeholder="Search for a car here"
            id="search-input"
          />
        </div>
      </div>

      <div className="flex flex-col w-full md:grid md:grid-cols-3 md:gap-3">
        {cars.length == 0 ? (
            <Spinner animation="border" role="status">
              <span className="visually-hidden">Loading...</span>
            </Spinner>
          ) : (
            cars.map((e) => <PopulateCars car={e} />)
          )}
      </div>
    </section>
  );
};
